import React from "react";
import Header from "./Header";
import Footer from "./Footer";
import Writenote from "./Writenote";
import notes from "../notes";
import Inputarea from "./Inputarea";



function App()
{

    return <div><Header /> 
      <Inputarea />
    {notes.map((note)=> <Writenote 
        title={note.title}
        body={note.content} 

        />)}
     <Footer /> </div>
}
export default App;
